import { useState } from "react";

function Navbar() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="bg-white shadow-md fixed w-full z-50">
      <div className="container mx-auto flex justify-between items-center px-6 py-4">
        <div className="text-xl font-bold text-blue-600">AI Content Generator</div>

        <div className="hidden md:flex space-x-6">
          <a href="#home" className="hover:text-blue-600">Home</a>
          <a href="#services" className="hover:text-blue-600">Services</a>
          <a href="#support" className="hover:text-blue-600">Support</a>
        </div>

        <button 
          className="md:hidden text-blue-600 text-2xl" 
          onClick={() => setIsOpen(!isOpen)}
        >
          â˜°
        </button>
      </div>

      {/* Mobile menu */}
      {isOpen && (
        <div className="md:hidden bg-white px-6 pb-4 space-y-2">
          <a href="#home" className="block hover:text-blue-600">Home</a>
          <a href="#services" className="block hover:text-blue-600">Services</a>
          <a href="#support" className="block hover:text-blue-600">Support</a>
        </div>
      )}
    </nav>
  );
}

export default Navbar;
